TABLEATTRIBUTE.VALUE:
UPDATE out_payment_result_citi r SET (TXT_STATUS, DTE_UPDATE) = (SELECT 'DELETE',SYSDATE FROM DUAL) WHERE EXISTS (SELECT 1 FROM out_payment_result_trace t, out_payment_detail d, IN_ETL_CONTROL ICTRLDATE, IN_ETL_CONTROL ICTRLTYPE, IN_ETL_CONTROL ICTRLMAXDT WHERE r.TXT_STATUS='ACTIVE' and t.txt_status ='ACTIVE' AND ICTRLDATE.TXT_KEY_STRING = 'OPER_CYCLE_DATE' AND ICTRLDATE.TXT_FILE_NAME='GLOBAL' AND ICTRLTYPE.TXT_KEY_STRING='$$STR_PAYMENT_CYCLE_TYPE' AND ICTRLTYPE.TXT_FILE_NAME='$$STR_PROCESSING_UNIT' AND d.DTE_CYCLE_DATE = TO_DATE(ICTRLDATE.TXT_KEY_VALUE,'YYYY-MM-DD') AND d.TXT_CYCLE_TYPE = ICTRLTYPE.TXT_KEY_VALUE and d.txt_processing_unit = ICTRLTYPE.TXT_FILE_NAME AND R.dec_paymentresultseq=t.dec_paymentresultseq AND t.dec_paymentdetailseq = D.dec_paymentdetailseq AND t.txt_settlment_way='GIRO' AND ICTRLMAXDT.TXT_KEY_STRING='$$STR_MAX_CYCLE_DATE' AND ICTRLMAXDT.TXT_FILE_NAME='$$STR_PROCESSING_UNIT' AND NVL(ICTRLMAXDT.dec_enforce_flg,0) !=2 ) AND TXT_STATUS='ACTIVE' ;
UPDATE out_payment_result_trace SET (TXT_STATUS, DTE_UPDATE) = (SELECT 'DELETE',SYSDATE FROM DUAL) WHERE txt_status ='ACTIVE' AND dec_paymentresultseq IN ( SELECT dec_paymentresultseq FROM out_payment_result_citi WHERE txt_status ='DELETE' );
COMMIT;

